import React from "react";
import bnbimg from "../Images/binance.jpg";

function Buy () {
    return(
        <div className="container-buy">
            <p class="whereto">Where to buy cryptocurrencies?</p>
            <div className="binancedesc">
            <a href="https://www.binance.com"><img src={bnbimg} alt="" /></a>
            <p className="binancedescp"> Hello</p>
            </div>
            
        </div>
    );
}

export default Buy;
